import React, {useState, useEffect, useContext} from 'react'
import { Link } from 'react-router-dom';
import usersAPI from '../API/users'
import { OpenWorkspacesContext } from '../Contexts/openWorkspacesContext';
import AddIcon from '@mui/icons-material/Add';

const Shortcut = ({type}) => {
    const {addOpenWorkspaces} = useContext(OpenWorkspacesContext);
    const [items, setItems] = useState();
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        const fetchData = async () => {
            try {
                let items;

                if (type === "workspaces") {
                    items = await usersAPI.get(`/created-workspaces-shortcut`);
                } else if (type === "dataset") {
                    items = await usersAPI.get(`/created-datasets-shortcut`);
                } else if (type === "bookmark-workspaces") {
                    items = await usersAPI.get(`/bookmarked-workspaces-shortcut`);
                } else {
                    items = await usersAPI.get(`/bookmarked-datasets-shortcut`);
                }

                setItems(items.data.data)
                setLoaded(true);
            } catch (err) {}
        }
        fetchData();
    }, [])

    return (
        <>
            {loaded &&
                <div className="home-my-workspaces-container">
                    <div className="home-my-workspaces-heading">
                        <p>{type === "workspaces" ? "Created Workspaces" : (type === "dataset") ? "Created Datasets" 
                            : (type === "bookmarked-workspaces") ? "Bookmarked Workspaces" : "Bookmarked Datasets"}</p>
                        {type === "workspaces" && 
                            <Link to="/new-workspace">
                                <AddIcon className="home-my-workspaces-new-workspace-icon" />
                            </Link>
                        }
                        {type === "dataset" && 
                            <Link to="/new-dataset">
                                <AddIcon className="home-my-workspaces-new-workspace-icon" />
                            </Link>
                        }
                    </div>
                    <div className="home-my-workspaces-list">
                        {items.map((item, i) => {
                            return (
                                <Link to={type === "workspaces" ? `/workspace/${item._id}` : (type === "dataset") ? `/dataset/${item._id}` 
                                    : (type === "bookmarked-workspaces") ? `/workspace/${item._id}` : `/dataset/${item._id}`}
                                        className="home-my-workspaces-item" 
                                        onClick={() => {addOpenWorkspaces(item._id, item.title)}}
                                        key={i}>
                                    <img src={`http://localhost:4000/images/${item.picture}`} />
                                    <p>{item.title}</p>
                                </Link>
                            )
                        })}
                        <Link to={type === "workspaces" ? "/created-workspaces" : (type === "dataset") ? "/created-datasets" 
                            : (type === "bookmarked-workspaces") ? "/bookmarked-workspaces" : "/bookmarked-datasets"}
                                className="home-my-workspaces-all">See All</Link>
                    </div>
                </div>
            }
        </>
    )
}

export default Shortcut
